import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class HabiticaTile extends Component {
  render() {
    return (
      <div className="col-2">
        <Link to="/habitica">
          <div className="tile">
            <div>Habitica</div>
            <div>Check Profile</div>
          </div>
        </Link>
      </div>
    );
  }
}
